import { Swiper, SwiperSlide } from "react/swiper";
import "swiper/css";

function Carousel() {
  return (
    <div className="h-[600px] bg-white">
      <Swiper>
        loop={true}
        spaceBetween={0}
        className="h-[50%]"
      </Swiper>
      <SwiperSlide>
        <img src={"../images/carousel_1.jpg"} alt="" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={"../images/carousel_2.jpg"} alt="" />
      </SwiperSlide>
    </div>
  );
}

export default Carousel;
